import React from 'react';
import { hexbin as d3Hexbin } from 'd3-hexbin';
import * as d3 from 'd3'; // Import d3 to access hexagon function

export const Marks = ({ bins }) => {
    return (
        <g className="marks">
            {bins.map((bin, i) => (
                <path
                    key={i}
                    d={d3Hexbin().hexagon(30)} // Use d3Hexbin to create the hexagon shape
                    transform={`translate(${bin.x}, ${bin.y})`} // Position using centroid
                    fill="orange" // Change fill as needed
                    stroke="black"
                    strokeWidth={1}
                />
            ))}
        </g>
    );
};
